import Product from './Product';
import Title from './Title';
import {amazinProducts} from '../inventory';

class ProductList extends Component {

    state = {
        products: amazinProducts
    };
    
    render() {
        return (
            <React.Fragment>
                <div className="py-5">
                    <div className="container">
                        <Title name="Amazin" title="products"/>

                        <div className="row"></div>
                    </div>
                </div>
            </React.Fragment>
                // <Product />
        );
    }
}

export default ProductList;
